import React from 'react';
import ReactDOM from 'react-dom';
import Card from './Card';
import CardData from './CardInfo';

//console.log(CardData[1]);

function nCard(value){
  return (
    <Card
      src={value.mySrc}
      link={value.myLink}
      category={value.myCategory}
      title={value.myTitle}
    />

  );
}

ReactDOM.render(
  <>
      newCarData = {CardData.map(nCard)} 

  </>,document.getElementById('root')
);
